@keitherton

If you actually look it up, the US has done way more copying of television shows (some successful, some not)

True both countries can produce quality TV shows but when the US does so the BBC (or one of other broadcast companies) will acuire the rights to regularly air it. That basically never happens in the States. Also we have a lot more available channels, so there's a lot more room for not so great shows.
